import React, {useState, useEffect} from 'react'

function DocTitleOne() {
    const [count, setCount] = useState(0)

    useEffect(() => {
        document.title = `Title - `
    }, [])

  return (
    <div>
        <button onClick={() => setCount(count + 1)}>Count - {count}</button>
    </div>
  )
}

export default DocTitleOne
